import React, { useState } from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';
import PhotoIcon from '@mui/icons-material/Photo';

const GeneratedImage = () => {
    const [img, setImg] = useState(null);

    return (
        <Paper variant='outlined'>
            <Grid2 container sx={{ px: 4, py: 4 }}>
                <Box component='div' alt='image generate' src='' sx={{
                    width: '100%',
                    height: '600px'
                }}>
                    {img ?
                        (<Box>

                        </Box>)
                        : <PhotoIcon />}

                </Box>
            </Grid2>
        </Paper>
    )
}

export default GeneratedImage
